import React from 'react'
import '../data/products'

function Repetitation(props){
    function getProdutosListItem(){
    return produtos.map(prod => {
        return <li>{prod.id} - {prod.nome} - {prod.preco}</li>
    })
    }

return(
    <div>
        <h2>Repetição</h2>
        <ul>
         {getProdutosListItem}
        </ul>
    </div>
)
}
export default Repetitation;
